import React from 'react'
import {
	StyleSheet,
	Text,
	View,
	Image,
	TouchableWithoutFeedback,
	StatusBar,
	SafeAreaView,
	Keyboard,
	TouchableOpacity,
	KeyboardAvoidingView,
	Dimensions,
	TouchableHighlight,
} from "react-native";
import Logo from '../assets/images/glow-modified.png'
import { LinearGradient } from "expo-linear-gradient";
import { BlurView } from "expo-blur";
import { TextInput } from "react-native-paper";


const UserRegistration = () => {
  return (
		<LinearGradient
			style={styles.container}
			colors={["#1F4690", "#646FD4"]}
			start={{
				x: 1,
				y: 1,
			}}
			end={{
				x: 0,
				y: 0,
			}}
		>
			<View
				style={{ flexDirection: "column", alignItems: "center", marginTop: 80 }}
			>
				<Image source={Logo} style={{ width: 80, height: 80 }}></Image>
				<View style={{ marginTop: 20, marginStart: 20 }}>
					<Text style={styles.Text}>Provide Your Some Details</Text>
					<Text style={styles.Text}>Get a To Lift Lae Ly Services </Text>
				</View>
				<BlurView
					intensity={75}
					style={{
						paddingBottom: 300,
						borderTopStartRadius: 15,
						borderTopEndRadius: 15,
						paddingLeft: 10,
						paddingRight: 10,
					}}
				>
          <Text>Full Name</Text>
					<TextInput
						label="Enter Your Name"
						style={styles.input}
						
						placeholder="Ahmed Ali"
						
						
					/>
				</BlurView>
			</View>
		</LinearGradient>
	);
}
const android = Dimensions.get("window");
const styles = StyleSheet.create({
	container: {
		flex: 1,
		width: android.width,
		height: android.height * 1.5,
	},
	Text: {
		color: "white",
		fontSize: 28,
		fontWeight: "bold",
		textAlign: "center",
	},
	input: {
		
		borderTopLeftRadius: 20,
		borderBottomLeftRadius: 20,
		borderBottomRightRadius: 20,
		width: android.width * 0.94,
		height: 60,
		borderTopRightRadius: 20,
		shadowColor: "#000",
		shadowOffset: {
			width: 0,
			height: 3,
		},
		shadowOpacity: 0.29,
		shadowRadius: 4.65,

		elevation: 7,
	},
});

export default UserRegistration
